import React from 'react'

const Home = () => {
    return (
        <div
            style={{
                marginRight: '10px',
            }}
        >
            <div
                className='suggested'
                style={{
                    marginRight: '7px',
                }}
            >
                Suggested for you
            </div>
            <div className='body-food'>
                <div
                    style={{
                        display: 'flex',
                        justifyContent: 'space-around',
                        height: '24.8rem',
                    }}
                >
                    <div>
                        Lorem ipsum dolor sit amet consectetur adipisicing elit. Tempore ad non porro quisquam sequi
                        neque. In nesciunt quo ex deleniti dolorum soluta, nobis quidem, incidunt ipsa dolor ad,
                        architecto doloribus.
                    </div>
                    <div>
                        Lorem ipsum dolor sit amet consectetur adipisicing elit. Assumenda placeat eius, beatae voluptas
                        quam architecto commodi maiores minus sed consectetur, veritatis consequuntur. Nemo id repellat
                        mollitia aut laboriosam, placeat odio.
                    </div>
                    <div></div>
                </div>
            </div>
        </div>
    )
}

export default Home
